import React, { Component } from 'react';
import Widecard from '../components/Widecard.js';

class SkillsEdu extends Component {
    render() {
        return (
            <FadeIn delay="800" transitionDuration="1200">
            <div className="container" style={{ paddingTop: '7%'}}>
                <h1>Education</h1>
                <Widecard title="Computer Science" where="Becker College" from="August 2017" to="Current"></Widecard>
                <Widecard title="High School Student" where="Seoul American High School" from="August 2013" to="June 2017"></Widecard>
            </div>
            </FadeIn>
        )
    }
}

export default SkillsEdu;
